import DisabledTaggingAction from "../actiontype/disabled-tagging.actiontype";

export const enableAllTaggings = data => dispatch => {
    dispatch(enableBlankCallTagging());
    dispatch(enableCallTransferTagging());
    dispatch(enableFtrTagging());
    dispatch(enableSrTagging());
    dispatch(enableCallDropTagging());
    dispatch(enableCallDropScenarioTagging());
    dispatch(enableSubHeaderOutstandingFTRTagging());
    dispatch(enableMultipleDynamicFTRTagging());
    dispatch(enableMultipleDynamicSrTagging());
}
export const enableBlankCallTagging = data => ({
    type: DisabledTaggingAction.BLANK_CALL_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledBlankCallTagging = data => ({
    type: DisabledTaggingAction.BLANK_CALL_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableCallTransferTagging = data => ({
    type: DisabledTaggingAction.CALL_TRANSFER_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledCallTransferTagging = data => ({
    type: DisabledTaggingAction.CALL_TRANSFER_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableFtrTagging = data => ({
    type: DisabledTaggingAction.FTR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledFtrTagging = data => ({
    type: DisabledTaggingAction.CALL_TRANSFER_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableSrTagging = data => ({
    type: DisabledTaggingAction.SR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledSrTagging = data => ({
    type: DisabledTaggingAction.SR_TAGGING_DISABLED,
    payload: { status: true }
});

export const enableCallDropTagging = data => ({
    type: DisabledTaggingAction.CALL_DROP_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledCallDropTagging = data => ({
    type: DisabledTaggingAction.CALL_DROP_TAGGING_DISABLED,
    payload: { status: true }
});

export const enableCallDropScenarioTagging = data => ({
    type: DisabledTaggingAction.CALL_DROP_SCENARIO_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledCallDropScenarioTagging = data => ({
    type: DisabledTaggingAction.CALL_DROP_SCENARIO_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableScenarioFTRTagging = data => ({
    type: DisabledTaggingAction.SCENARIO_FTR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledScenarioFTRTagging = data => ({
    type: DisabledTaggingAction.SCENARIO_FTR_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableScenarioSRTagging = data => ({
    type: DisabledTaggingAction.SCENARIO_SR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledScenarioSRTagging = data => ({
    type: DisabledTaggingAction.SCENARIO_SR_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableSubHeaderOutstandingFTRTagging = data => ({
    type: DisabledTaggingAction.SUB_HEADER_OUTSTANDING_FTR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledSubHeaderOutstandingFTRTagging = data => ({
    type: DisabledTaggingAction.SUB_HEADER_OUTSTANDING_FTR_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableSubHeaderOutstandingSRTagging = data => ({
    type: DisabledTaggingAction.SUB_HEADER_OUTSTANDING_SR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledSubHeaderOutstandingSRTagging = data => ({
    type: DisabledTaggingAction.SUB_HEADER_OUTSTANDING_SR_TAGGING_DISABLED,
    payload: { status: true }
});
export const enableBillComoparatorFTRTagging = data => ({
    type: DisabledTaggingAction.BILL_COMPARATOR_FTR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledBillComoparatorFTRTagging = data => ({
    type: DisabledTaggingAction.BILL_COMPARATOR_FTR_TAGGING_DISABLED,
    payload: { status: true }
});

export const enablePlanUsageCardFTRTagging = data => ({
    type: DisabledTaggingAction.PLAN_USAGE_FTR_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledPlanUsageCardFTRTagging = data => ({
    type: DisabledTaggingAction.PLAN_USAGE_FTR_TAGGING_DISABLED,
    payload: { status: true }
});

export const enableMultipleDynamicFTRTagging = data => ({
    type: DisabledTaggingAction.MULTIPLE_DYNAMIC_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledMultipleDynamicFTRTagging = (status, multiDynamicTaggingKey) => ({
    type: DisabledTaggingAction.MULTIPLE_DYNAMIC_TAGGING_DISABLED,
    payload: { status: true, multiDynamicTaggingKey: multiDynamicTaggingKey }
});

export const enableMultipleDynamicSrTagging = data => ({
    type: DisabledTaggingAction.MULTIPLE_DYNAMIC_TAGGING_ENABLED,
    payload: { status: false }
});
export const disabledMultipleDynamicSrTagging = (status, multiDynamicTaggingKey) => ({
    type: DisabledTaggingAction.MULTIPLE_DYNAMIC_TAGGING_DISABLED,
    payload: { status: true, multiDynamicTaggingKey: multiDynamicTaggingKey }
});
